import React from "react";
import { Link } from "react-router-dom";

const SearchResults = ({ results }) => {
  renderResults = (results) => {
    if (!results) console.log("results variable is undefined");
    else if (results === 0)
      return (
        <div
          style={{
            border: "1px solid tomato",
            color: "tomato",
            margin: "20px",
          }}
        >
          <h1>SearchResults Component</h1>
          <p>No results</p>
        </div>
      );
    else
      return (
        <div
          style={{
            border: "1px solid tomato",
            color: "tomato",
            margin: "20px",
          }}
        >
          <h1>SearchResults Component</h1>
          <ul
            style={{
              border: "1px solid crimson",
              color: "crimson",
              margin: "20px",
            }}
          >
            {results.slice(0, 10).map((result, index) => (
              <Link key={index} to={`/search/${result[2]}`}>
                {result[0]}, {result[1]}
              </Link>
            ))}
          </ul>
        </div>
      );
  };
  return <React.Fragment>{renderResults(results)}</React.Fragment>;
};

export default SearchResults;
